import React from 'react';

const Stats = () => {
  return (
    <section className="estadisticas" style={{ display: 'flex', justifyContent: 'space-around', margin: '20px' }}>
      <div className="stat" style={{ background: '#e74c3c', color: '#fff', padding: '10px', borderRadius: '5px' }}>Seguidores: 609M</div>
      <div className="stat" style={{ background: '#e74c3c', color: '#fff', padding: '10px', borderRadius: '5px' }}>Seguidos: 568</div>
      <div className="stat" style={{ background: '#e74c3c', color: '#fff', padding: '10px', borderRadius: '5px' }}>Publicaciones: 3571</div>
    </section>
  );
}

export default Stats;
